INSERT INTO `OrderAgency` VALUES (1,'1','','2554-09-22','2554-09-22','2554-09-22','2554',309,0,'การแต่งตั้งคณะกรรมการบริหารคณะวิทยาศาสตร์','-','N',0,'','Ot','',''),(2,'2','','2554-09-22','2554-09-22','2554-09-22','2554',309,0,'การแต่งตั้งคณะกรรมการประจำคณะวิทยาศาสตร์','-','N',0,'','Ot','',''),(4,'๒๐๐/๒๕๕๕','ฝ่ายวิจัยและบัณฑิตศึกษา','2555-07-23','2555-07-15','2555-10-30','2555',290,7,'การแต่งตั้งคณะกรรมการระบบสารสนเทศอิเลกทรอนิกส์','เพื่อการดำเนินการการประชุมอิเลกทรอนิกส์เป็ไปด้วยความเรียบร้อย','Y',0,'','Ot','เอกรัฐ ศรีสุข','รองคณบดีฝ่ายวิจัยและบัณฑิตศึกษา|'),(6,'0001/2554','คำสั่งคณะวิทยาศาสตร์ มหาวิทยาลัยบูรพา','2554-10-23','2554-10-01','2555-09-30','2555',309,0,'แต่งตั้งกรรมการบริหารงานของภาควิชาชีววิทยา','เพื่อให้การบริหารงานด้านต่าง ๆ ของภาควิชาชีววิทยา คณะวิทยาศาสตร์ เป็นไปด้วยความเรียบร้อยและมีประสิทธิภาพ และเป็นงานบริหารข้อ 2.6 (2.6.6) ตามคู่มือการประเมินผลการปฏิบัติงานของข้าราชการกลุ่มผู้ดำรงตำแหน่ง ประเภทวิชาการ พ.ศ. 2554 คณะวิทยาศาสตร์ มหาวิทยาลัยบูรพา จึงอาศัยอำนาจตามความในมาตรา 35 แห่งพระราชบัญญัติมหาวิทยาลัยบูรพา พ.ศ. 2550 จึงขอแต่งตั้งบุคคลต่อไปนี้เป็นกรรมการบริหารงาน ของภาควิชาชีววิทยา ดังนี้','N',0,'','Ot','ดร.ณรงค์   อึ้งกิมบ้วน','รองคณบดีฝ่ายบริหาร รักษาการแทน|คณบดีคณะวิทยาศาสตร์'),(7,'0001/2554','คณะวิทยาศาสตร์','2554-11-01','2554-11-01','2554-11-01','2555',309,0,'การไล่ออก','การไล่ออก','Y',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(8,'','','2555-07-23','2555-07-23','2555-07-23','2555',290,7,'','','N',0,'','Ot','','|'),(10,'001/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-03','2555-07-02','2556-05-31','2556',25,16,'แต่งตั้งคณะกรรมการดำเนินการแข่งขันคณิตศาสตร์โอลิมปิกระดับชาติ   ครั้งที่ 10','','N',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(11,'002/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-03','2555-12-06','2556-09-30','2556',25,16,'แต่งตั้งคณะกรรมการตรวจรับตำรา  เรื่อง  การอนุมานเชิงสถิติ','','N',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(12,'003/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-04','2556-01-04','2556-09-30','2556',25,16,'แต่งตั้งคณะกรรมการดำเนินการจัดหาโดยวิธีตกลงราคา – ดำเนินการจัดจ้าง ทาสีภายนอกอาคารวิทยาศาสตร์ชีวภาพ  จำนวน 1 อาคาร','','Y',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(13,'004/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-04','2555-11-16','2556-09-30','2556',25,16,'แต่งตั้งคณะกรรมการฝ่ายบริการทางวิชาการ  คณะวิทยาศาสตร์  (เพิ่มเติม)','','N',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(14,'005/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-08','2556-01-01','2556-12-31','2556',25,16,'แต่งตั้งคณะกรรมการบริหารแบบมีส่วนร่วมคณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','','N',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|'),(15,'006/2556','คณะวิทยาศาสตร์  มหาวิทยาลัยบูรพา','2556-01-08','2556-01-08','2556-09-30','2556',25,16,'แต่งตั้งคณะกรรมการตรวจสอบข้อเท็จจริงของข้าราชการที่ยื่นเรื่องขอรับค่าเช่าบ้าน','','N',0,'','Ot','ผู้ช่วยศาสตราจารย์อุษาวดี  ตันติวรานุรักษ์','คณบดีคณะวิทยาศาสตร์|');
